import React from "react";

const ListItems = ({ item }) => {
  return (
    <li className="list-group-item">
      <p>{item}</p>
      <p>{item}</p>
      <button type="button" className="btn btn-danger mt-2 p-1">
        Send
      </button>    </li>
  );
};

export default ListItems;
